INSERT INTO `infoboards` (`id`, `message`, `user_id`, `guest`, `created`, `category`) VALUES
(1, 'You are making a fantastic job, Zemke.', 2, '0', '2012-07-26 17:07:21', 1),
(2, 'Welcome guest! When you want login, please note, that usernames and passwords are case sensitive. When you''ve forgotten or never obtained a password, please contact us via mail (check the footer)', 0, 'Joschi', '2012-07-26 17:53:09', 4),
(3, '@Joschi www.cwtsite.com/users/resetPW/id', 1, '0', '2012-07-26 19:45:22', 2),
(4, '@Joschi Meine Handynummer: 015209631488', 1, '0', '2012-07-26 19:46:00', 2),
(5, '@Joschi Bis die Tage. :)', 1, '0', '2012-07-26 19:46:07', 2),
(6, 'Hey @khamski because of Facebook Timeline. You are always free to comment there. If you want edit/modify CWT 2009, I can give you, for a period, manager rights, so you can write in the name of CWT.', 2, '0', '2012-07-26 20:09:07', 2),
(7, 'I got a few errors by just randomly clicking around ;s', 30, '0', '2012-07-26 20:52:06', 1),
(8, 'for example clicking on the cup pictures on the player list gives me an error.', 30, '0', '2012-07-26 20:54:46', 1),
(9, 'ignore that, normally cups shouldn''t be linked. second error?', 2, '0', '2012-07-26 20:56:43', 1),
(10, '@franz Welcome!', 2, '0', '2012-07-27 00:03:51', 2),
(11, 'Oh yeah, forgot to unlink them. :>', 1, '0', '2012-07-27 00:54:18', 1),
(12, 'Now you can also submit donations for the CWT winners. Thanks Kayz for managing this.', 1, '0', '2012-07-27 01:37:16', 1),
(13, ':)', 10, '0', '2012-07-27 03:00:47', 1),
(14, 'for the CWT winner*', 10, '0', '2012-07-27 03:01:05', 1),
(15, '@Joschi okay i will use that. Really inspiring thing. I love it.', 5, '0', '2012-07-27 07:13:29', 2),
(16, '@Zemke downsize the logo image. It''s huge. Maybe you already did that. Didn''t check.', 5, '0', '2012-07-27 07:50:20', 2),
(17, '@Zemke donation menu  icon don''t have a name on it. Chrome here.', 5, '0', '2012-07-27 07:53:07', 2),
(18, '@Zemke Help has no instructions how to use a board. I think it just need few things like using @ for privates.', 5, '0', '2012-07-27 07:53:57', 2),
(19, '@Zemke This thing is too awesome no neglect. So i will stream CWT and participate in others streams :). You are buncha disrespective chaps but you created a great site. So i forgive you. )', 5, '0', '2012-07-27 08:04:20', 2),
(20, '@Zemke you missed skype in contacts. It''s a huge tool nowdays. Will also be used in streams. So pls add it. Just a request though. Hope it''s not hard.', 5, '0', '2012-07-27 08:07:21', 2),
(21, '@Zemke social networks must open in a separate window. Otherwise we loose cwtsite after a click. Again just a request. Hope you get the idea.', 5, '0', '2012-07-27 08:12:29', 2),
(22, 'Yup, i gotta say i am impressed. Stylish, functional, no bullcrap. Great work. Now we all must work to give admins a useful bugreport. Click archive button, lads. Nice journey to the CWT past.', 5, '0', '2012-07-27 08:28:08', 1),
(23, '@khamski okay, I made you manager of the site. now you can write in the name of CWT.', 2, '0', '2012-07-27 09:44:00', 2),
(24, '@khamski maybe you have an idea for a more original facebook banner', 2, '0', '2012-07-27 09:44:34', 2),
(25, 'in Chrome, the "donate" letters aren''t displayed.', 2, '0', '2012-07-27 09:48:23', 1),
(26, 'How did you guys found that old picture of me dressed up for lab work? :P', 25, '0', '2012-07-27 14:43:47', 1),
(27, '@Joschi yup, i''ll play with some old photos as Zemke asked', 5, '0', '2012-07-27 14:48:43', 2),
(28, 'That picture is from old site content. Sorry when it deleted newer uploaded profile pictures, this archiv was quiet a mess.', 2, '0', '2012-07-27 14:50:20', 1),
(29, '@khamski Zemke will answer you, as soon as his new flat got internet. This may take a while.', 2, '0', '2012-07-27 14:51:56', 2),
(30, 'it''s ok. I don''t care about this or that picture, just surprised to see it. I thought I uploaded one of me in the Azorean laurel forest doing field work.', 25, '0', '2012-07-27 14:56:42', 1),
(31, '@Joschi okay, i will throw feedback to him so he can use it later when he gets online', 5, '0', '2012-07-27 15:51:04', 2),
(32, '@Joschi *i will be throwing*', 5, '0', '2012-07-27 15:52:31', 2),
(33, '@Zemke login cookie would be great. No neccesary though.', 5, '0', '2012-07-28 17:29:40', 2),
(34, 'nice idea with facbook :)', 13, '0', '2012-07-29 09:28:28', 1),
(35, 'Nice page...  And one thing, you put that i did not play 2010 but i played group stage, and then i broke my finger and i was replaced. But i played 3 games...', 12, '0', '2012-07-29 13:30:48', 1),
(36, '@Zemke after login it opens players page. Not good. Its better to open main page with chatbox and stuff', 5, '0', '2012-07-29 16:50:24', 2),
(37, 'Hi Hi Hello :D Pls reset my password ;)', 0, 'Jellenio', '2012-07-29 17:27:05', 4),
(38, '"quarter final" is spelled "querterfinal"', 27, '0', '2012-07-29 20:40:38', 1),
(39, '@Zemke   The logo seems to be too big for slower connections, it takes like a minute here to finish loading. If it''s going to be resized to something not bigger than 800x600 pixels in the site display then you could resize the image file to that.', 27, '0', '2012-07-29 20:46:44', 2),
