(1864, '@Korydex I never had those problems.', 2, '0', '2013-03-20 18:26:27', 2),
(1865, '@Joschi Yeah, it must be me.', 4, '0', '2013-03-22 13:14:09', 2),
(1866, 'Thanks to Waffle, he''s restored some games. Also thanks to Kukumber and Joschi for their more than 400 restored games. You guys are at the heart of CWT.', 1, '0', '2013-03-25 20:32:47', 1),
(1867, 'Where do I find these games? :3', 4, '0', '2013-03-27 06:48:28', 1),
(1868, 'I''m afraid there are only results, no replays. Actually I don''t even think replays were already enabled in the times of the earlier editions of CWT.', 158, '0', '2013-03-28 05:05:58', 1),
(1869, 'Replays feature in WA was added in the early 2004. Though, as I remember from an the old chat with Joschi and Zemke some years were on WWP...', 4, '0', '2013-03-28 06:40:07', 1),
(1870, ' I think some replays of 2007 were uploaded somewhere around here... Am I wrong?', 4, '0', '2013-03-28 06:43:34', 1),
