(1872, 'I remember, Chuvash wrote: "I see big skill difference...". xD Maybe we can use search for it... Probably it''s here, probably at NNN site.', 4, '0', '2013-03-28 07:04:25', 1),
(1873, 'Here, provided by Zemke :) cwtsite.com/tournaments/download/replays', 158, '0', '2013-03-28 17:31:12', 1),
(1874, 'By the way, the link to those replays have been in the footer at the bottom of this page for months.', 1, '0', '2013-03-29 14:35:24', 1),
(1875, 'I don''t really think someone ever used those tiny buttons :P', 158, '0', '2013-03-29 17:15:24', 1),
(1876, 'ah i kinda thought it links to the last cwt replays', 4, '0', '2013-03-30 05:34:54', 1),
(1877, 'No further changes in archive development? No officialy published winner pictures? And FB isn''t up-to-date as well. kukumber, are you going to host upcoming event please?', 2, '0', '2013-04-04 21:45:28', 1),
(1878, 'And what do you actually mean by hosting? :)', 158, '0', '2013-04-05 21:26:33', 1),
(1879, 'To take the role of a head moderator.', 2, '0', '2013-04-06 10:03:58', 1),
(1880, 'Well, we discussed it with Zemke, I''m going to be one of moderators of CWT 2013, if that''s what you mean.', 158, '0', '2013-04-06 11:07:19', 1),
(1881, 'We don''t have all winner photos yet. FaD''s missing and Kayz is pushing him. About the archive â€¦ no further action until all games have been restored.', 1, '0', '2013-04-07 17:57:08', 1),
(1882, 'Great news that Kayz is pushing something xD I would like to see an archive then.', 2, '0', '2013-04-17 20:38:28', 1),
(1883, 'guys, this is hilarious, that kukumber and me made 90% of game restoring and now nothing happens.', 2, '0', '2013-04-25 08:06:53', 1),
(1884, 'What is supposed to happen now?', 1, '0', '2013-04-26 19:30:45', 1),
(1885, 'I will try to finish restoring, though I can''t promise anything :) A bit busy and a bit lazy :P', 158, '0', '2013-04-26 20:11:43', 1),
(1886, 'It''s not about the unfinished registered games. It''s about who is pushing things? Obviously it''s not the current head moderator.', 2, '0', '2013-05-02 13:53:27', 1),
(1887, 'http://www.normalnonoobs.com/forum/viewtopic.php?f=9&t=1348', 1, '0', '2013-05-15 12:12:32', 1),
(1888, 'I was just called to intervene to try to peacefully resolve an apparent crisis situation regarding a threat to kill the CWT board. I honestly think that I can''t say much about what is going on, but one fact is true: I am sorry that CWT has been put in front an NNN issue. The loss of our message board is not a good thing, still it wouldn''t be unsolvable by simply creating a new one. On the other hand, I can''t see why the NNN issue is unresolved. A grave consequence for CWT, a small issue for NNN.', 25, '0', '2013-06-02 10:36:24', 1),
(1889, 'Guys, calm down. Joschi did brought some real effort into CWT. He has some clear issues and character flaws but he did his job awesomely well. Let''s chill and try to understand each other. I am sure Joschi doesn''t really wants to bring any harm to something he worked so long and so hard.', 5, '0', '2013-06-02 12:32:40', 1),
(1890, '@Zemke hey. There is 2009 folder only in the game archive. Is it the lastgames to put in?', 5, '0', '2013-06-02 12:51:56', 2),
(1891, '@khamski There''s no game archive.', 1, '0', '2013-06-02 15:53:18', 2),
(1892, 'Speechless - how can admins think that they are owners of my own forum account. I want them to delete it and they reject my two weeks old application. I am sorry for my ugly threat, but otherwise, I fear, they won''t change their opinion.', 2, '0', '2013-06-02 17:17:47', 1),
(1893, 'as a consequence of your poor try to disable my cwt forum account, I disabled your admin rights and the access to your accounts.', 2, '0', '2013-06-02 17:34:25', 1),
(1894, '@Joschi nobody think they own your account rights. Kilo tried to delete it. Even Koras did. Let''s talk and solve this situation. I can''t talk for everyone but i myself respect the work you''ve done. So you have a right to be a bit strange and bitchin'' Lets talk this all over via skype. Just add me or let me add you. I don''t know your skype nick. We will talk and find the ways. Maybe you can give instructions how to make that erase doable. ', 5, '0', '2013-06-02 23:12:16', 2),
(1895, '@Joschi my skype: khamski', 5, '0', '2013-06-02 23:24:20', 2),
(1896, 'Hey, Joschi. You don''t answer my private messages. Can you add me in skype? Nick: khamski. We worked in 2009 together so i hope you won''t decline a little ex-mods talk. I won''t bother you long.', 5, '0', '2013-06-04 08:55:05', 1),
(1897, 'Okay, i wrote to Joschi''s active email and added|messaged his active skype. So i hope if he really need something from NNN he will contact me and we will solve all technical issues in a calm respective way.', 5, '0', '2013-06-04 13:52:10', 1),
(1898, 'Yeah also i tried to contact him in fb. He didn''t approve the invitation yet.', 5, '0', '2013-06-04 14:43:44', 1),
(1899, 'You tried a lot of ways. I didn''t want to ignore anybody, but talking with too many people just isnt effective aswell. That I am talking with the half NNN clan via  forum escaped you? Well, seriously, I think Zemke should reply my messages, then everything would be fine.', 2, '0', '2013-06-04 15:35:41', 1),
(1900, '@khamski "Kilo tried to delete it. Even Koras did" He tried it once, when I was logged into forums. Koras doesn''t have admin powers to do so. The whole clan decided not to delete my account. My threat provoked half-hearted reactions. If they would take me serious, there wouldnt be a problem. Tomorrow, when I am forced to do what I saied, then we will have problems.', 2, '0', '2013-06-04 15:47:43', 2),
(1901, 'To be honest, Joschi, what you''re about to do to CWT does hurt me and it has so very deeply disappointed me. ', 1, '0', '2013-06-04 15:48:27', 1),
(1902, 'Always try to understand the other side. I clearly saied that I want my account deleted - gently and without any anger. I feel robbed of my own right to decide about my given datas. I even didn''t expected you to delete my posts. But your arrogancy and the need to demonstrate power brought me in this situation with my ugly threat. What else could have brought you to do what I ask you?', 2, '0', '2013-06-04 16:04:28', 1),
(1903, 'And now these lies with technical problems... only to gain time and hack/ban my forum accounts.', 2, '0', '2013-06-04 16:05:54', 1),
(1904, 'I understand you. NNN has decided not to delete you. Now you want to delete the CWT forum.', 1, '0', '2013-06-04 16:06:24', 1),
(1905, 'You have a problem with NNN, not with CWT or me. But you''ve made it a problem of CWT and me. Thanks.', 1, '0', '2013-06-04 16:07:23', 1),
(1906, 'And I''m not gonna leave NNN jsut because of that, because in contrast to you I''m loyal.', 1, '0', '2013-06-04 16:08:48', 1),
(1907, 'NNN has decided to refuse my wishs/to rob my rights. btw. the archive of CWT isn''t deleted, but not visible for no-admins. I rechange this.', 2, '0', '2013-06-04 16:08:51', 1),
(1908, 'You''re giving the middle finger to me after our year long good work and I''ve not done any bad to you.', 1, '0', '2013-06-04 16:10:24', 1),
(1927, 'Seems like all old games are reported. I finished years 2005 and 2006. Can''t wait to see those tables.', 5, '0', '2013-06-29 11:57:57', 1),
(1928, 'Great, great. So, have really all games been restored? It would be unfavorable to add games after processing the restored games.', 1, '0', '2013-06-30 14:24:38', 1),
(1929, 'If you did add/fix everything I told you about then 2002-2004 is complete for sure :)', 158, '0', '2013-07-01 05:05:57', 1),
(1930, 'I''ve just restored another 128 games from 2011 and 2012 and working on integrating them into the system. The archive should be up during August. Of course I will keep you guys informed as we move towards the grand comeback of the archive of CWT.', 1, '0', '2013-07-26 22:32:12', 1);
